import './App.css';
import logo from './wre-logo.png';
//import backgroundImage from './background-image.webp';

function App() {
  return (


    <div class="background">
      <div class="logo">

        <img src={ logo } alt="logo" />

        <nav class = "navigation">
          <a href="">Buy a Home</a> |
          <a href="">Sell a Home</a> |
          <a href="">Find an Agent</a> |
          <a href=""> About Us </a>
        </nav>

        </div>
      </div>

  );
}

export default App;
